import React, { Component } from "react";

import CommunitySanitary from "./communitySanitary";
import CompostPits from "./compostPits";
import SoakPits from "./soakPits";
import WasteCollection from "./wasteCollection";
import VehicleCollecion from "./vehicleCollection";
import CommunityBio from "./communityBio";

class CommunityAssets extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
    };

    this.componentWillMount = this.componentWillMount.bind(this);
  }

  componentWillMount() {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((res) => res.json())
      .then((data) => this.setState({ items: data }));
  }
  render() {
    const { items } = this.state;
    return (
      <div>
        <div class="panel panel-default card-view village-basic-wrapper community-assets">
          <div class="panel-heading blue">
            <div class="pull-left">
              <h6 class="panel-title txt-light">
                Community Assets-Key Indicators
              </h6>
            </div>
            <div class="clearfix"></div>
          </div>
          <div class="panel-wrapper collapse in">
            <div class="panel-body">
              <div className="row">
                <div className="col-lg-4 col-md-4 col-sm-12 col-xs-12">
                  <CommunitySanitary />
                  <WasteCollection />
                </div>
                <div className="col-lg-4 col-md-4 col-sm-12 col-xs-12">
                  <CompostPits />
                  <VehicleCollecion />
                </div>
                <div className="col-lg-4 col-md-4 col-sm-12 col-xs-12">
                  <SoakPits />
                  <CommunityBio />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CommunityAssets;
